const Searchbar = ({ fetchTeams, teams }) => {



  return (
    <section>
      <form>
        <label htmlFor="searchLeague">Search league:</label>
        <input type="searchLeague" id="searchLeague" name="searchLeague" />
        <input type="submit" value="Search" onClick={fetchTeams('PL')} />
      </form>
      {teams.map((team, i) => <div>{team.name}</div>)}
    </section>
  )
};

export default Searchbar;
